  [],\n\t\"revision_timestamp\": \"2015-05-07T03:53:04.043042\",\n\t\"name\": \"structural-health-monitoring-with-fiber-bragg-grating-and-piezo-arrays-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Intelligent Fiber Optic Systems Corporation
  (IFOS) in collaboration with Washington State University (WSU) proposes an approach
  of utilizing structurally integrated, distributed optical FBG sensor/piezo actuator
  arrays to monitor the health of a structure with accurate interpretation of sensor
  signals and real-time data processing.  Our method involves a dynamic response-based
  damage detection technique that offers a simple identification method with easy
  implementation.  We use electrically passive, electromagnetic interference (EMI)
  immune, multiplexable, fiber optic sensing technology with many sensors on a single
  light-weight small diameter optical fiber.  This is currently the most cost-effective
  and aerospace friendly way to overcome the sensor impoverished state of present
  day structures. This method has the capability of inspecting large area structures
  to provide global as well as local structural health information in real time.  As
  well as providing weight reduction, the miniaturization enabled by our optical fiber
  technology is key to diverse spin-off applications such as for sensor matrices in
  NASA's extra-vehicular and planetary exploration robots as well as sensor arrays
  for medical applications and homeland security robotic disarming of bombs. \",\n\t\"license_title\":
